import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import AppBody from "./components/AppBody";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Router>
        <>
          <Header />
          <AppBody/>


        </>
        )
      </Router>
    </div>
  );
}

export default App;
